import React from "react";
import "../Home.css";
import "../QuemSomos.css";
import "bootstrap/dist/css/bootstrap.min.css";


import HeaderQuemSomos from "../QuemSomos/headerQsomos";
import QuemsomosIMG from "../QuemSomos/QuemSomosImg";
import Quemsomos from "../QuemSomos/QuemSomos";
import Footer from "../LandingPage/footer";



function Home() {
  return (
    <React.Fragment>
      <HeaderQuemSomos/>
      
      <QuemsomosIMG/>
      <Quemsomos/>
      <Footer />
    </React.Fragment>
  );
}


export default Home;
